function Form() {
    return (
        <div className="container">
            <form>
            <div class="mb-3">
                <label for="mT" class="form-label">Multiply To</label>
                <input type="email" class="form-control" id="mT" placeholder="15" />
            </div>
            </form>
        </div>
    );
}

export default Form;
